import React, { Component } from 'react';
import { Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap';




const Contato = (props) => {
    return (
      <div className="container d-xl-flex p-5">
      <Form className="container align-items-xl-center p-5 rounded" id="body-section">
        <FormGroup>
          <Label for="exampleEmail">Nome</Label>
          <Input type="email" name="email" id="exampleEmail" placeholder="Seu nome" />
        </FormGroup>
        <FormGroup>
          <Label for="exampleEmail">E-mail</Label>
          <Input type="email" name="email" id="exampleEmail" placeholder="Seu e-mail" />
        </FormGroup>
        <FormGroup>
          <Label for="exampleText">Escreva sua mensagem aqui</Label>
          <Input type="textarea" name="text" id="exampleText" />
        </FormGroup>
        <Button color="dark">Enviar</Button>
      </Form>
      </div>
    );
  }


export default Contato;
